            background: #4f46e5;
            color: white;
            border: none;
            border-radius: 8px;
            padding: 10px 14px;
            font-size: 16px;
            font-weight: 600;
            cursor: pointer;
          }

          button:hover {
            background: #4338ca;
          }

          .error {
            margin-top: 15px;
            background: #fee2e2;
            color: #991b1b;
            padding: 10px;
            border-radius: 8px;
            text-align: center;
          }
        `}
      </style>
    </div>
  );
};

